DROP TABLE IF EXISTS `t_book`;
CREATE TABLE `t_book` (
  `id` bigint(30) NOT NULL,
  `book_id` varchar(128) DEFAULT NULL,
  `book_name` varchar(30) DEFAULT NULL,
  `book_kind` varchar(20) DEFAULT NULL COMMENT '书的类型',
  `book_price` decimal(10,2) DEFAULT NULL,
  `book_cover_pic` varchar(255) DEFAULT NULL COMMENT '书的封面',
  `book_intro` varchar(255) DEFAULT NULL COMMENT '书的简介',
  `book_pck_style` varchar(20) DEFAULT NULL COMMENT '开本',
  `is_joining_activity` tinyint(1) DEFAULT NULL COMMENT '是否参加优惠活动',
  `book_status` tinyint(2) DEFAULT NULL COMMENT '书的状态：0-下架;1-待上架;2-上架;3-热销',
  `book_publisher` varchar(50) DEFAULT NULL COMMENT '出版商',
  `book_publish_date` date DEFAULT NULL COMMENT '出版日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

