-- ----------------------------
-- Procedure structure for `findBookByBookId`
-- ----------------------------
DROP PROCEDURE IF EXISTS `findBookByBookId`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `findBookByBookId`(
	IN bookId BIGINT,
	OUT id  BIGINT,
	OUT bookName VARCHAR(30),
	OUT bookAuthor VARCHAR(20),
	OUT bookPrice INTEGER,
	OUT publishDate VARCHAR(20),
	OUT bookKind VARCHAR(20),
	OUT totalStore INTEGER,
	OUT totalSold INTEGER,
	OUT bookPic VARCHAR(255),
	OUT bookProfile VARCHAR(255),
	OUT bookStatus TINYINT(1)
)
BEGIN
SELECT key_id,book_name,author,price,publish_date,kind,total_store,total_sold,pic,book_profile,book_status 
INTO id,bookName,bookAuthor,bookPrice,publishDate,bookKind,totalStore,totalSold,bookPic,bookProfile,bookStatus
FROM t_book
WHERE book_id=bookId;
END
;;
DELIMITER ;
